import React from 'react';


function SquareList(props) {
  let squarelist = [];
  for(let i=0; i<9; i++) {
    squarelist.push(
      <li 
        className='square'
        key={i}
        onClick={() => props.onClick(i)}
      >{props.mark[i]}
      </li>) 
  }

  return (
    <ul className='board'>
      {squarelist}
    </ul>
  );
}

export default SquareList;
